  input: TEXT,F3A,,"Included in the original report was a contribution from the partnership
    Colleran, O'Hara and Mills for $7,000.  Due to human error this excess of funds
    was received and reported.  On February 13, 2003 a refund check for $5,000 was
    returned to the partnership, this covers $3,000 for the General Election and $2,000
    for the Primary.  This refund check will be reported in the April 15th quarterly
    report for 2003.                   Reported on this report was a contribution
    for $500 from James P. Bolye this is the son of James Bolye was made two $1,000
    on this same report.     Corrections made on this report are Carol O'Rourke contribution
    on 8/28/02 for $1,000 should be marked for the General Election.  Colleran, O'Hara
    & Mills contribution for $4,000 should be marked for the General Election.  Due
    to human errror Benjamin Klemanowicz was mistakenly to have contributed $2,000
    during this reporting period, he in fact only contributed $1,000 that is why there
    was only one 48-Hour notice reported."
